import React from 'react'
import FormatQuoteIcon from '@mui/icons-material/FormatQuote';
import { SvgIcon } from '@mui/material';
export default function Header() {
    return (
        <div className="header-wrapper">
        <div className="text-wrapper">
            <p><SvgIcon component={FormatQuoteIcon}></SvgIcon><span className="dash">---</span><span className="text-between">Your</span><span className="text-center">Personal</span><span className="text-between">Recipes</span><span className="dash">---</span></p>

        </div>
        <div className="text-sub"><span>Manage your collections!</span></div>



        </div>
    )
}
